import React, {useState} from 'react';
import './App.css';

interface IForm {
    firstName: string,
    lastName: string
}

interface ChildFormsProps {

}

const ChildForms: React.FC = ({deleteClicked}) => {
    const [state,setState] = useState<IForm>({
        firstName:'',
        lastName:''
    });

    const formHandleChanged = (event: React.ChangeEvent<HTMLInputElement>) => {
        setState(({
            ...state,
            [event.target.name] : event.target.value
        }))
    };

    return(
        <div className="form">
            <input
                placeholder={"firstName"}
                value={state.firstName}
                name="firstName"
                onChange={formHandleChanged.bind(this)}
                type="text"  />
            <input
                placeholder={"lastName"}
                value={state.lastName}
                name="lastName"
                onChange={formHandleChanged.bind(this)}
                type="text"  />
        </div>
    )
};

export default ChildForms;
